import logo from './logo.svg';
import './App.css';
import home from './././Components/home';
import { Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Switch>
      <Route path = './home'  component={home} exact/>
      </Switch>
    </div>
  );
}

export default App;
